        return <div className='pharmarack-cms-form-error-message login'><i className='fa fa-circle-xmark'></i> Please enter you email or phone number</div>
    };

    return (

        <div className="pharmarack-cms-register-wrapper">

            {displayErrorMsg()}

            <div className="pharmarack-cms-register-form">

                <div className="pharmarack-cms-register-form-header">
                    <img src="/assets/imgs/logo.svg" />
                    <p>Registration</p>
                </div>

                <div className="pharmarack-cms-form-fields">
                    <div className="pharmarack-cms-form-row">
                        <input type='text' placeholder='Full Name' value={state.username} />
                    </div>
                    <div className="pharmarack-cms-form-row">
                        <input type='text' placeholder='Email Id' value={state.username} />
                    </div>
                    <div className="pharmarack-cms-form-row">
                        <input type='text' placeholder='Mobile Number' value={state.username} />
                    </div>
                    <div className="pharmarack-cms-form-row">
                        <select>
                            <option value="" default selected>Select user type</option>
                        </select>
                    </div>
                    <div className="pharmarack-cms-form-row">
                        <input type='password' placeholder='Password' value={state.password} />
                    </div>
                    <div className="pharmarack-cms-form-row">
                        <input type='password' placeholder='Confirm Password' value={state.password} />
                    </div>
                </div>

                <div className="pharmarack-cms-form-action">
                    <button className={`pharmarack-cms-btn primary block ${state.loading ? "loading" : ""}`} >Register</button>
                    <p className='pharmarack-cms-login-link-wrapper'>Already a User? <a href="#" className='pharmarack-cms-login-link'>Login Now</a></p>
                </div>

            </div>

        </div>

    )

}

export default Login;
